# Bakeyevo, Sterlibashevsky District, Republic of Bashkortostan

}}
Bakeyevo (; , BaqÄ±y) is a rural locality (a selo) and the administrative centre of Bakeyevsky Selsoviet, Sterlibashevsky District, Bashkortostan, Russia. The population was 507 as of 2010. There are 6 streets.
Geography
Bakeyevo is located 13&nbsp;km southeast of Sterlibashevo (the district's administrative centre) by road. Novonikolayevka is the nearest rural locality.
